import React from "react";
import { useState } from "react";
import Channel from "../channel/Channel";

export default function TeamChat() {
    /*const [channels, setChannels] = useState([]);*/
    const channels = {
        '1' : {
            name: 'Design',
            icon: null,
            members : ['1', '2', '3'],
            messages : [{
                    text: 'Hello',
                    sender_id : '1',
                    timestamp: '21:18:53'
                }, 
                {
                    text: 'Hey',
                    sender_id: '2',
                    timestamp: '21:18:54'
                },
                {
                    text: 'Heyo guuuys',
                    sender_id: '3',
                    timestamp: '21:18:56'
                }]
        },

        '2' : {
            name: 'Dev-channel',
            icon: null,
            members : ['2', '4', '1'],
            messages : [{
                    text: 'Hello',
                    sender_id : '1',
                    timestamp: '21:18:53'
                }, 
                {
                    text: 'Hey',
                    sender_id: '4',
                    timestamp: '21:18:54'
                },
                {
                    text: 'Heyo guuuys',
                    sender_id: '2',
                    timestamp: '21:18:56'
                }]
        },
        '3': {
            name: 'Finance',
            icon: null,
            members : ['2', '1'],
            messages : [{
                    text: 'Hello',
                    sender_id : '1',
                    timestamp: '21:18:53'
                }, 
                {
                    text: 'Hey',
                    sender_id: '2',
                    timestamp: '21:18:54'
                }]
        }
    }

    return (
        <div className="team-chat">
            <div className="channels">
                {channels.map((channel) => {
                    return <Channel name={channel.name}
                                    message_count = {channel.messages.length}
                    />
                })}
            </div>
        </div>
    )

}
